import Layout from '../components/Layout'

class Index extends React.Component{

    constructor(props){
        super(props)
        console.log(props.url.pathname)
    }
    render(){
        return(
            <Layout activeClass={this.props.url.pathname}>
                <h1>Welcome </h1>
            </Layout>
        )
    }
} 


export default Index;
